const input = [
    '',
    '',
    '',
    '',
    ''
];


// 'X' represents no button
// [row][col]
const buttons = [
    ['X', 'X', '1', 'X', 'X'],
    ['X', '2', '3', '4', 'X'],
    ['5', '6', '7', '8', '9'],
    ['X', 'A', 'B', 'C', 'X'],
    ['X', 'X', 'D', 'X', 'X']
];

//start at '5'
var row = 2;
var col = 0;

function clamp(min, max) {
    return function(val) {
        return Math.min(Math.max(val, min), max);
    }
}

const clampButtons = clamp(0,4);

input.forEach((line) => {
    line.split('').forEach((direction) => {
        let newVal;
        switch (direction) {
            case 'U':
                newVal = clampButtons(row - 1);
                if (buttons[newVal][col] !== 'X') {
                    row = newVal;
                }
                break;
            case 'D':
                newVal = clampButtons(row + 1);
                if (buttons[newVal][col] !== 'X') {
                    row = newVal;
                }
                break;
            case 'L':
                newVal = clampButtons(col - 1);
                if (buttons[row][newVal] !== 'X') {
                    col = newVal;
                }
                break;
            case 'R':
                newVal = clampButtons(col + 1);
                if (buttons[row][newVal] !== 'X') {
                    col = newVal;
                }
                break;
        }
    });
    console.log(`Push ${buttons[row][col]}`);
});
